import React from 'react';
import { SwitchCase, Route, Switch } from 'react-router-dom';

import Home from './pages/Home/';
import Login from './pages/Login/';
import CadAluno from './pages/Cadaluno/';
import EditAluno from './pages/Cadaluno/edit';
import SignUp from './pages/Signup';
import DeshBoard from './pages/Dashboard';
import StudentInfo from './pages/StudentInfo';
import NoteFound from './pages/Notefound';

export default  () =>{
    return (
        <Switch>
          <Route exact path="/">
            <Home/>
          </Route>

          <Route path="/login">
            <Login/>
          </Route>

          <Route path="/registration">
            <CadAluno />
          </Route>

          <Route path="/signup">
            <SignUp />
          </Route>

          <Route path="/dashboard">
            <DeshBoard/>
          </Route>

          <Route path="/student/info/:id">
            <StudentInfo/>
          </Route>

          <Route path="/student/edit/:ids">
            <EditAluno/>
          </Route>

          <Route>
            <NoteFound/>
          </Route>

        </Switch>
    )
}
